import React from 'react';


let zip = (a1, a2) => a1.map((x, i) => [x, a2[i]]);
const items = zip(props.game1LeaderBoardIndex[0],props.game1LeaderBoardUsername);


const User = (props) =>
        <tr>
        {props.items}
          <td >{props.game1LeaderBoardIndex}</td>
          <td >{props.game1LeaderBoardUsername}</td>
          <td >{props.game1LeaderBoardStage}</td>
          <td >{props.game1LeaderBoardTries}</td>
          <td >xxx</td>
        </tr>
export default User;
